import gamesObject from '../Data/games.json';
import { Image } from 'react-bootstrap';

function ListMovies() {
    const games = gamesObject.games;
    return (
        <div className="container ">
        <div className="row justify-content-center g-1 ">
            {games.map((game) => (
                <div key={game.name} className="col-auto col-sm-6 col-md-4 col-lg-3">
                    <Image src={game.coverUrl} alt={game.name} className = "img-fluid width:100%" width="250" height="375"/>
                </div>
            ))}
        </div>
        </div>
    )
}

export default ListMovies;
